            "def": " Dar comêço a, para que outros acompanhem: tirar a reza; tirar a modinha. Extrahir, arrancar: tirar um dente. Puxar. Attrahir. Extractar. Auferir, receber: tirar lucros. Libertar. Dissuadir: ninguém me tira disto. Apartar. Separar. Privar de. Tolher. Derivar: tirar conclusões. Usurpar. Furtar. Arrecadar. Lucrar. Atirar, arremessar. Eliminar. Reproduzir. Exceptuar. Exportar. Abolir; extinguir. Estampar, imprimir. Despir. "
